import { createRouter, createWebHashHistory } from 'vue-router'

import SomethingBeautiful from '../components/SomethingBeautiful.vue'

const routes = [
  { path: '/first', name: 'HomeScreen', component: SomethingBeautiful }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
